\begin{align*}
\frac{x - 6}{5 - 6} &= \frac{y - 8}{3 - 8} \\
\Rightarrow \quad 3(x - 6) &= 5(y - 8) \\
\Rightarrow \quad 3x - 5y &= -14 \quad \text{(1)}
\end{align*}
Koordinaatit $(6, 8)$ ja $(7, 4)$ ovat kautta leitettävä jana, joka on yhdensuunta ja yhdensäarinen jana koordinaatit $(5, 3)$ ja $(x, y)$. Täten
\begin{align*}
\frac{x - 5}{6 - 5} &= \frac{y - 3}{8 - 3} \\
\Rightarrow \quad 5(x - 5) &= 3(y - 3) \\
\Rightarrow \quad 5x - 3y &= 16 \quad \text{(2)}
\end{align*}
Kertaa yhtälöt (1) ja (2) yhtäsuuruudettaan:
\begin{align*}
15x - 21y &= -70 \\
-9x + 7y &= 48 \\
\hline
6x - 14y &= -22 \\
3x - 7y &= -11
\end{align*}
Tässä yhtälö on samanlaisen yhtälön (1) ja (2) yhteenlasku. Vastaus: $x + y = \boxed{11}$.

